    <script>

// 3.pid=metaweb_int&c={CAMPAIGN_NAME}&af_siteid={APP_ID}&af_c_id={CAMPAIGN_ID}&af_adset={ADSET_NAME}&af_adset_id={ADSET_ID}&af_ad={AD_NAME}&af_ad_id={AD_ID}&af_click_lookback=7d&fbclid={{fbclid}}
        function buildFacebookURL(p0, p1, p2, p3, p4, p5, fbClickId, af_siteid) {
            console.log(this);

            let af_ad_id = p0;
            console.log(">>af_ad_id", af_ad_id);
            let af_adset_id = p1;
            console.log(">>af_adset_id", af_adset_id);

            let c = p3;

            console.log(">>af_ad", af_ad);

            console.log(">>af_adset", af_adset);
            let fbclid = fbClickId;

            let params = { af_ad_id, af_adset_id, af_c_id, c, af_ad, af_adset, fbclid, af_siteid };

            let newURL = "https://app.appsflyer.com/id6740477802?pid=metaweb_int&af_click_lookback=7d" + '&' +

        // get fbpid from Cookie written by Facebook Pixel
        function getFbPid() {
            let fbPid = document.cookie.match(/(^|;) ?_fbp=([^;]*)(;|$)/);
